import Button from "@mui/material/Button";
import React from "react";

export default function AddTasks({ handler }): JSX.Element {
    return (
        <Button
        onClick={handler}
        variant="contained"
        sx={{ borderRadius: 28, minWidth: 0, borderWidth: 0, position: "fixed", top: "93%", left: "93%"}}
            >
            +
        </Button>
    );
}

function ParentComponent(props) {
  // the function
  function yourFunction() {
    alert("The function has been called!");
  };

  return <ChildComponent action={yourFunction} />
};

function ChildComponent({action}) {

  // call the function once on mount
  React.useEffect(() => {
    action();
  }, []);

  return "I'm the child component!";
};
